def _maybe_empty_lines(self, current_line: Line) -> Tuple[int, int]:
    max_allowed = 1 if current_line.depth > 0 else 2

    # Check if it's a decorator, definition, or class line
    if current_line.is_decorator or current_line.is_def or current_line.is_class:
        if not current_line.is_decorator:
            self.previous_defs.append(current_line.depth)

        if self.previous_line is None or self.previous_line.is_decorator:
            return 0, 0
        else:
            newlines = 2 if current_line.depth > 0 else 1
            return newlines, 0

    # Check if it's a flow control line
    if current_line.is_flow_control:
        return 0, 1

    # Check if it's an import line or a yield line
    if self.previous_line and self.previous_line.is_import and (not current_line.is_import) and current_line.depth == self.previous_line.depth:
        return min(self.previous_line.prefix.count("\n") or 1, max_allowed), 0
    elif self.previous_line and self.previous_line.is_yield and (not current_line.is_yield or current_line.depth != self.previous_line.depth):
        return min(self.previous_line.prefix.count("\n") or 1, max_allowed), 0

    return min(current_line.leaves[0].prefix.count("\n") or 1, max_allowed), 0
